window.bookSummaryJSON = "<p>There are some days when you should just stay in bed.</p> <p>Jon Hunter begins to realize this, as the consequences of saying yes, when he should have said no, begin to add up.</p> <p>The trouble with making tech advances, is someone will always come up with a counter eventually. And when this occurs on one of those days you should have stayed in bed, the cosmos tends to demonstrate just how many ways things can actually go wrong.</p> <p>But time is ticking away. The door to Jon's home, and all the answers he so desperately wants, is soon to open.</p> <p>But it's no longer a question of will he get there on time, but will he get there at all?</p>"; 
